import { useState, useEffect } from "react";
import "./App.css";
function App() {
  const [datas, setDatas] = useState(null);
  useEffect(() => {
    fetch("http://localhost:8000/data")
      .then((res) => {
        return res.json();
      })
      .then((db) => {
        setData(db.advisorProfileCollection.items)
      });
  }, []);
  return (
    <div>
      {data}
    </div>
  )
}

export default App;
